import css from 'styled-jsx/css';

export default css`.footer-wrap {
  background-color: #262626;
  height: 601px;
  box-sizing: border-box;
  padding-top: 113px;
}
.footer-wrap .company-info ul {
  width: 170px;
  height: 267px;
  display: inline-block;
  vertical-align: top;
}
.footer-wrap .company-info ul li {
  position: relative;
  font-size: 15px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #fefefe;
  line-height: 30px;
}
.footer-wrap .company-info ul li img {
  width: 143px;
  height: 143px;
  margin-bottom: 24px;
}
.footer-wrap .company-info ul:last-child {
  width: 100px;
}
.footer-wrap .company-info ul:not(:last-child) {
  margin-right: 130px;
}
.footer-wrap .company-info ul:not(:first-child) {
  padding-top: 68px;
}
.footer-wrap .company-info ul:not(:first-child) li:first-child {
  margin-bottom: 40px;
  height: 40px;
  font-size: 16px;
  font-family: Source Han Sans CN;
  font-weight: bold;
  color: #fefefe;
  line-height: 30px;
}
.footer-wrap .company-info ul:not(:first-child) li:first-child:after {
  display: block;
  content: "";
  position: absolute;
  left: 0;
  bottom: 0;
  width: 19px;
  height: 1px;
  background-color: #fff;
}
.footer-wrap .company-info .info {
  width: 370px;
}
.footer-wrap .registered-NO span,
.footer-wrap .registered-NO a {
  height: 16px;
  font-size: 16px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #fefefe;
  line-height: 30px;
}
`
